export enum IconSize {
  DEFAULT = "1em",
  NORMAL = "1rem",
  MEDEIUM_SMALL = "1.25rem",
  MEDIUM = "1.45rem",
  LARGE = "1.7rem",
  MEDIUM_LARGE = "2rem",
  BIG_LARGE = "2.25rem", //standard-line-height
  LARGE_LARGE = "2.75rem", //standard-line-height
  SUPER_LARGE = "4rem"
}

export interface IconConifgProps {
  label?: string;
  labelSize?: "large" | "small";
  size?: IconSize;
  hover?: boolean;
  color?: JDColor;
  tooltip?: string;
  selected?: boolean;
  dots?: JSX.Element[];
}

interface IConProps extends React.HTMLAttributes<HTMLOrSVGElement> {
  icon: IIcons;
}

const JDIcon: React.FC<IConProps & IconConifgProps> = ({
  label,
  icon,
  hover,
  onClick,
  size,
  tooltip,
  color,
  labelSize,
  className,
  selected,
  dots,
  ...props
}) => {
  const classes = classNames("JDicon", className, {
    JDicon__svg: true,
    "JDicon__svg--hover": hover,
    ...colorClass("JDicon", color),
    "JDicon__svg--selected": selected
  });

  const newId = s4();

  const style = {
    width: size,
    height: size
  };
  return (
    <Fragment>
      <svg
        {...props}
        alignmentBaseline="central"
        className={classes}
        style={style}
        version="1.1"
        viewBox="0 0 24 24 "
        onClick={onClick}
        data-tip={tooltip ? true : false}
        data-for={tooltip && `btnTooltip${newId}`}
      >
        <g>
          <path d={icons[icon]} />
        </g>
      </svg>
      {tooltip && (
        <Tooltip type="dark" effect="solid" id={`btnTooltip${newId}`}>
          <span>{tooltip}</span>
        </Tooltip>
      )}
      {dots && <span className="JDicon__dots">{dots.map(Dot => Dot)}</span>}
      {label && (
        <span
          className={`Icon__label ${labelSize === "large" &&
            "Icon__label--large"}`}
        >
          {label}
        </span>
      )}
    </Fragment>
  );
};

JDIcon.defaultProps = {
  size: IconSize.DEFAULT,
  hover: false
};

export {icons};

export default JDIcon;
